import React,{Component} from 'react';
import Menu from '../menu/menu';

class Results extends Component{
    render(){
        return(
            <div>
                <Menu />
        <center> <h1 className="resComp">Results Component</h1></center>
         </div>
        )
    }
}
export default Results;
